(ccp/F_VygFLn0ijQ9-_5CN5pmXBCfR0fY rdfs/label ["Transmembrane serine/threonine kinase forming with the TGF-beta type I serine/threonine\n                kinase receptor, TGFBR1, the non-promiscuous receptor for the TGF-beta cytokines TGFB1, TGFB2 and TGFB3.\n                Transduces the TGFB1, TGFB2 and TGFB3 signal from the cell surface to the cytoplasm and is thus\n                regulating a plethora of physiological and pathological processes including cell cycle arrest in\n                epithelial and hematopoietic cells, control of mesenchymal cell proliferation and differentiation, wound\n                healing, extracellular matrix production, immunosuppression and carcinogenesis. The formation of the\n                receptor complex composed of 2 TGFBR1 and 2 TGFBR2 molecules symmetrically bound to the cytokine dimer\n                results in the phosphorylation and the activation of TGFRB1 by the constitutively active TGFBR2.\n                Activated TGFBR1 phosphorylates SMAD2 which dissociates from the receptor and interacts with SMAD4. The\n                SMAD2-SMAD4 complex is subsequently translocated to the nucleus where it modulates the transcription of\n                the TGF-beta-regulated genes. This constitutes the canonical SMAD-dependent TGF-beta signaling cascade.\n                Also involved in non-canonical, SMAD-independent TGF-beta signaling pathways.\n            " "en"])
(ccp/R_db93o_z2AQn0XWf8p5un0kHP6s0 rdf/type ccp/IAO_EXT_0001109)
