(ccp/F__RTB312UR-vnBY_t0dDb7Gdmt7I rdfs/label ["Homodimer. Heterohexamer; TGFB1, TGFB2 and TGFB3 homodimeric\n                ligands assemble a functional receptor composed of two TGFBR1 and TGFBR2 heterodimers to form a\n                ligand-receptor heterohexamer. The respective affinity of TGFRB1 and TGFRB2 for the ligands may modulate\n                the kinetics of assembly of the receptor and may explain the different biological activities of TGFB1,\n                TGFB2 and TGFB3. Interacts with DAXX. Interacts with TCTEX1D4. Interacts with ZFYVE9; ZFYVE9 recruits\n                SMAD2 and SMAD3 to the TGF-beta receptor. Interacts with and is activated by SCUBE3; this interaction\n                does not affect TGFB1-binding to TGFBR2. Interacts with VPS39; this interaction is independent of the\n                receptor kinase activity and of the presence of TGF-beta.\n            " "en"])
