(ccp/F_naYlAtnbfvnaTbdEnwKirDusEnA rdfs/label ["The disease is caused by mutations affecting the gene represented in this entry. TGFBR2\n                mutations Cys-460 and His-460 have been reported to be associated with thoracic aortic aneurysms and\n                dissection (TAAD). This phenotype, also known as thoracic aortic aneurysms type 3 (AAT3), is\n                distinguised from LDS2 by having aneurysms restricted to thoracic aorta. As individuals carrying these\n                mutations also exhibit descending aortic disease and aneurysms of other arteries (PubMed:16027248), they\n                have been considered as LDS2 by the OMIM resource.\n            " "en"])
